const React = require("react");

function Show({ flightsView }) {
  return (
    <div>
      <h1>Flight Info</h1>
      <p>
        The {flightsView.airline} flight no: {flightsView.flightNo}
        <br />
        <p>Departs: {flightsView.departs.toLocaleString()}</p>
      </p>
    </div>
  );
}

module.exports = Show;
